import React from 'react';
import Opts from './Menu-opt'
import camp12 from '../../images/camp12.jpg';
import camp13 from '../../images/camp13.jpg';
// import Header from '../Header'
import auth from '../../controller/routes/auth';

const Home = (props) => {
  const user = JSON.parse(localStorage.getItem('user'));

  return (
    <>
      <nav class="navbar navbar-expand-lg navbar-light bg-light">
        <a class="navbar-brand" href="#">Navbar</a>
        <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
          <span class="navbar-toggler-icon"></span>
        </button>
      <div class="collapse navbar-collapse" id="navbarNavAltMarkup">
      <div class="navbar-nav">
        <a class="nav-item nav-link active" href="#">Home <span class="sr-only">(current)</span></a>
        <a class="nav-item nav-link" href="#">Features</a>
        <a class="nav-item nav-link" href="#">Pricing</a>
        <a class="nav-item nav-link disabled" href="#" tabindex="-1" aria-disabled="true">Disabled</a>
      </div>
    </div>
    </nav>
      <section id="home-menu" className="fill-available mb-4 container-fluid d-flex flex-wrap align-content-around justify-content-center">
        <Opts click={() => { return auth.login(() => { props.history.push("/orders") })}} name="CATALOGO" imgMenu={camp12} />
        <Opts name="CATALOGO" imgMenu= {camp13}  />
        <Opts click={() => { return auth.login(() => { props.history.push("/pedidos") })}} name="PEDIDOS"  />
      </section>
    </>
  )
}

export default Home;
